export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{HUn8vufiFZ:{data:{id:600,attributes:{imdbId:"tt0094869",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTYyMDRhYzYtOGQ5YS00ZjE1LThhNzUtNWM4OGVjNTg5MzdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"82%"}],item_lang:{data:{id:1263,attributes:{title:c,plot:"A surreal portrait of a Catholic Private School and its hierarchy. A new student must submit to the bizarre rituals of his peers and the expectations of the school's administration by selling chocolates.",slug:"the-chocolate-war"}}},books:{data:[{id:691,attributes:{title:c,description:g,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NRWPDQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2004-01-01",publisher:"Ember",subtitle:b}},{id:692,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:d,published:e,publisher:f,subtitle:b}},{id:693,attributes:{title:c,description:g,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YHt-o7u1qqAC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2000-01-01",publisher:"Laurel Leaf",subtitle:b}},{id:694,attributes:{title:c,description:"One of the most controversial YA novels of all time, The Chocolate War is a modern masterpiece that speaks to fans of S. E. Hinton’s The Outsiders and John Knowles’s A Separate Peace. After suffering rejection from seven major publishers, The Chocolate War made its debut in 1974, and quickly became a bestselling—and provocative—classic for young adults. This chilling portrait of an all-boys prep school casts an unflinching eye on the pitfalls of conformity and corruption in our most elite cultural institutions. “Masterfully structured and rich in theme; the action is well crafted, well timed, suspenseful.”—The New York Times Book Review “The characterizations of all the boys are superb.”—School Library Journal, starred review “Compellingly immediate. . . . Readers will respect the uncompromising ending.”—Kirkus Reviews, starred review An ALA Best Book for Young Adults A School Library Journal Best Book of the Year A Kirkus Reviews Editor’s Choice A New York Times Outstanding Book of the Year",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NH1hB1raa1AC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:e,publisher:f,subtitle:b}},{id:695,attributes:{title:h,description:i,thumbnail:j,authors:[a],firstBook:d,published:e,publisher:f,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940942426}}("Robert Cormier","","The Chocolate War",null,"2013-03-19","Knopf Books for Young Readers","A high-school freshman who refuses to participate in the annual fund-raising chocolate sale is forced to defend his convictions.","Beyond the Chocolate War","The school year is almost at an end, and the chocolate sale is ancient history. But no one at Trinity School can forget the Chocolate War. Devious Archie Costello, commander of the secret school organization called the Vigils, still has some torturous assignments to hand out before he graduates. In spite of this pleasure, Archie is troubled that his right-hand man, Obie, has started to move away from the Vigils. Luckily Archie knows his stooges will fix that. But Obie has some plans of his own.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6ZowAxzxliMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))